// FormComponentInternship.js
import React from 'react';
import { Typography, Table, TableBody, TableCell, TableHead, TableRow } from '@mui/material';

const FormComponentInternship = ({ marksData }) => {
  return (
    <Box>
      <Typography variant="h5" gutterBottom sx={{ fontWeight: 'bold' }}>
        Subject-wise Marks
      </Typography>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell sx={{ fontWeight: 'bold' }}>Semester</TableCell>
            <TableCell sx={{ fontWeight: 'bold' }}>Subject</TableCell>
            <TableCell sx={{ fontWeight: 'bold' }}>Max Marks</TableCell>
            <TableCell sx={{ fontWeight: 'bold' }}>Passing Marks</TableCell>
            <TableCell sx={{ fontWeight: 'bold' }}>Marks Awarded</TableCell>
            <TableCell sx={{ fontWeight: 'bold' }}>Attempts</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {marksData.map((row, index) => (
            <TableRow key={index}>
              <TableCell>{row.semester}</TableCell>
              <TableCell>{row.subject}</TableCell>
              <TableCell>{row.maxMarks}</TableCell>
              <TableCell>{row.passingMarks}</TableCell>
              <TableCell>{row.marksAwarded}</TableCell>
              <TableCell>{row.attempts}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Box>
  );
};

export default FormComponentInternship;
